import { init, RuntimeMetadata, Methods } from 'merkleized-metadata'
import { useState, useMemo, useId, useEffect } from 'react'

export default function App() {
  const [mm, setMm] = useState<Methods>()

  useEffect(() => {
    init().then((mm) => setMm(mm));
  }, [])

  return mm
    ? <Main mm={mm} />
    : <div className="loading">Loading...</div>
}

type MainArgs = {
  mm: Methods
}

function Main(args: MainArgs) {
  const mm = args.mm;
  const [metadata, setMetadata] = useState(DEFAULT_METADATA)
  const [tx, setTx] = useState(DEFAULT_TX)
  const [decimals, setDecimals] = useState(DEFAULT_DECIMALS)
  const [tokenSymbol, setTokenSymbol] = useState(DEFAULT_TOKEN_SYMBOL)
  const [specVersion, setSpecVersion] = useState(DEFAULT_SPEC_VERSION)
  const [specName, setSpecName] = useState(DEFAULT_SPEC_NAME)
  const [base58Prefix, setBase58Prefix] = useState(DEFAULT_BASE58_PREFIX)

  const digestHash = useMemo(() => {
      const runtimeMetadata = RuntimeMetadata.fromHex(metadata);
      const digest = mm.generateMetadataDigest(runtimeMetadata, {
        base58Prefix,
        decimals,
        specName,
        specVersion,
        tokenSymbol
      })

      return digest.hash()
  }, [metadata, base58Prefix, decimals, specName, specVersion, tokenSymbol])

  const decimalsId = useId()
  const tokenSymbolId = useId()
  const specVersionId = useId()
  const specNameId = useId()
  const base58PrefixId = useId()
  const metadataId = useId()
  const txId = useId()

  return (
    <main>
      <h1>Merkleized Metadata Example</h1>
      <div className="entry">
        <label htmlFor={decimalsId}>Decimals</label>
        <input id={decimalsId} type='number' value={decimals} onChange={(e) => setDecimals(parseInt(e.target.value) || 0)}/>
      </div>
      <div className="entry">
        <label htmlFor={tokenSymbolId}>Token Symbol</label>
        <input id={tokenSymbolId} value={tokenSymbol} onChange={(e) => setTokenSymbol(e.target.value)}/>
      </div>
      <div className="entry">
        <label htmlFor={specVersionId}>Spec Version</label>
        <input id={specVersionId} value={specVersion} onChange={(e) => setSpecVersion(parseInt(e.target.value) || 0)}/>
      </div>
      <div className="entry">
        <label htmlFor={specNameId}>Spec Name</label>
        <input id={specNameId} value={specName} onChange={(e) => setSpecName(e.target.value)}/>
      </div>
      <div className="entry">
        <label htmlFor={base58PrefixId}>Base58 Prefix</label>
        <input id={base58PrefixId} value={base58Prefix} onChange={(e) => setBase58Prefix(parseInt(e.target.value) || 0)}/>
      </div>
      <div className="entry">
        <label htmlFor={metadataId}>Metadata Hex</label>
        <textarea id={metadataId} value={metadata} onChange={(e) => setMetadata(e.target.value)}/>
      </div>
      <div className="entry">
        <label htmlFor={txId}>Transaction Hex</label>
        <textarea id={txId} value={metadata} onChange={(e) => setTx(e.target.value)}/>
      </div>
      <div className="result">
        <div>
          Metadata Hash: {digestHash}
        </div>
      </div>
    </main>
  );
}

const DEFAULT_DECIMALS = 12
const DEFAULT_TOKEN_SYMBOL = "DOT"

// From the constant System.version
const DEFAULT_SPEC_VERSION = 1_011_000
const DEFAULT_SPEC_NAME = "rococo"

// From the constant System.ss58Prefix
const DEFAULT_BASE58_PREFIX = 42

// System.remark(Hello), Signed from Bob,
const DEFAULT_TX = "c10184008eaf04151687736326c9fea17e25fc5287613693c912909cb226aa4794f26a4801127d333c8f60c0d81dd0a6e2e20ea477a06f96aaca1811872c54c244f0935c60b1f8a38aabef3d3a4ef4050d8d078e35b57b3cf4f9545f8145ce98afb8755384550000000000001448656c6c6f"

// State.metadataAtVersion(15)
const DEFAULT_METADATA = ""